import styles from "./styles.module.css";
import logo from "../../assets/icons/logo.svg";

const Header = () => {
  return (
    <header className={styles.headerContainer}>
      <img src={logo} alt="logo" />

      <div className={styles.linkContainer}></div>
    </header>
  );
};

export default Header;
